import{_ as p}from"./plugin-vue_export-helper.21dcd24c.js";import{o as t,c as o,a as e}from"./app.38166bb6.js";var a="/DBC-Wiki/assets/1.c9841e29.jpg",s="/DBC-Wiki/assets/2.07ee5dd9.jpg",r="/DBC-Wiki/assets/3.ef6570ee.jpg",i="/DBC-Wiki/assets/3.ef6570ee.jpg",u="/DBC-Wiki/assets/5.ee2a0a59.jpg",c="/DBC-Wiki/assets/6.00a9e102.jpg",_="/DBC-Wiki/assets/7.573e358e.jpg";const m={},q=e('<h1 id="dbc-\u110B\u1175\u1109\u1161\u1112\u116C-\u1109\u1165\u11AB\u1100\u1165-\u1111\u1173\u1105\u1169\u1109\u1166\u1109\u1173" tabindex="-1"><a class="header-anchor" href="#dbc-\u110B\u1175\u1109\u1161\u1112\u116C-\u1109\u1165\u11AB\u1100\u1165-\u1111\u1173\u1105\u1169\u1109\u1166\u1109\u1173" aria-hidden="true">#</a> DBC \uC774\uC0AC\uD68C \uC120\uAC70 \uD504\uB85C\uC138\uC2A4</h1><p>https://t.youku.com/yep/page/m/957gtxr1a1?wh_weex=true&amp;isNeedBaseImage=1&amp;objectType=1&amp;objectCode=1450996867&amp;sharekey=50ac9db00159ca59a635d9ef76a7041a5</p><p>\uC774\uBBF8\uC9C0 \uBC84\uC804:</p><p>\uC6B0\uC120 Polkadot \uAE30\uBC18 DBC \uBA54\uC778\uB137 \uC9C0\uAC11\uC744 \uAC00\uC9C0\uACE0 \uC788\uC5B4\uC57C \uD569\uB2C8\uB2E4. \uC9C0\uAC11\uC744 \uB9CC\uB4E0\uD6C4 DBC \uBA54\uC778\uB137 \uC8FC\uC18C www.dbcwallet.io\uB97C \uC5F4\uACE0 &quot;\uAC70\uBC84\uB10C\uC2A4&quot; \uD074\uB9AD\uD569\uB2C8\uB2E4.</p><p><img src="'+a+'" alt=""></p><p>&quot;\uC758\uD68C&quot;\uD45C\uC2DC\uB429\uB2C8\uB2E4</p><p><img src="'+s+'" alt=""></p><p>\uD074\uB9AD\uD6C4 \uD604\uC7AC \uC758\uD68C \uC120\uAC70 \uC0C1\uD0DC \uBCFC\uC218\uC788\uC2B5\uB2C8\uB2E4</p><p><img src="'+r+'" alt=""></p><p>&quot;\uC758\uC11D&quot;--\uD604 \uC774\uC0AC\uD68C \uAD6C\uC131\uC6D0</p><p>&quot;runners up&quot;--\uC77C\uC2DC\uC801\uC73C\uB85C \uD0C8\uB77D\uD55C \uD6C4\uBCF4\uC790 (\uC900\uC6B0\uC2B9)</p><p>&quot;\uD6C4\uBCF4\uC790&quot;--\uD6C4\uBCF4\uC790 \uC81C\uCD9C\uD6C4 \uC77C\uC2DC\uC801\uC73C\uB85C 20\uC704\uC548\uC5D0 \uBABB\uB4E4\uC5B4\uAC04 \uCC38\uAC00\uC790\uB4E4</p><p><img src="'+i+'" alt=""></p><p>\uD398\uC774\uC9C0 \uC6B0\uCE21\uC0C1\uB2E8\uC5D0 &quot;\uD22C\uD45C&quot; \uBC0F &quot;\uD6C4\uBCF4\uC790\uC81C\uCE28&quot; \uC788\uC2B5\uB2C8\uB2E4</p><p>\uC774\uC0AC\uD68C \uC120\uAC70\uCC38\uC5EC \uD560\uB824\uBA74 &quot;\uD6C4\uBCF4\uC790\uC81C\uCD9C&quot;\uC73C\uB85C \uC774\uB3D9, \uD22C\uD45C\uB9CC \uD558\uB824\uBA74 &quot;\uD22C\uD45C&quot;\uB85C \uC774\uB3D9\uD569\uB2C8\uB2E4 .</p><p><strong>A.\uC6B0\uC120&quot;\uD22C\uD45C&quot; \uB2E8\uACC4 \uD655\uC778\uD569\uB2C8\uB2E4</strong></p><p><img src="'+u+'" alt=""></p><p>\uD074\uB9AD\uD6C4 \uC790\uCCB4 \uACC4\uC88C \uC794\uC561 \uD655\uC778\uD569\uB2C8\uB2E4</p><p>1\uAC1CDBC \uB294 1\uD45C\uC785\uB2C8\uB2E4,\uC8FC\uC758\uC0AC\uD56D: DBC\uAC00 1\uAC1C \uBBF8\uB9CC\uC77C \uACBD\uC6B0 \uD22C\uD45C \uBD88\uAC00\uC785\uB2C8\uB2E4</p><p><img src="'+c+'" alt=""></p><p>\uD655\uC778\uD6C4 \uC0AC\uC778\uD558\uC5EC \uC81C\uCD9C, \uBE44\uBC00\uBC88\uD638 \uC785\uB825\uD558\uBA74 \uB429\uB2C8\uB2E4</p><p><strong>B.\uB2E4\uC74C\uC740 &quot;\uD6C4\uBCF4\uC790 \uC81C\uCD9C &quot;\uD655\uC778\uD569\uB2C8\uB2E4</strong></p><p><img src="'+_+'" alt=""></p><p>\uC785\uB825 \uD6C4 \uC120\uAC70 \uCC38\uC5EC\uD560 \uACC4\uC815\uC744 \uC120\uD0DD\uD558\uC138\uC694.</p><p>&quot;\uD6C4\uBCF4 \uC790\uACA9 \uBC14\uC778\uB529&quot;\uC740 \uAE30\uBCF8\uC801\uC73C\uB85C \uC120\uAC70 \uC790\uACA9\uC744 \uC5BB\uAE30 \uC704\uD574 10,000\uAC1CDBC\uB85C \uBC14\uC778\uB529\uB429\uB2C8\uB2E4.</p><p>\uC81C\uCD9C \uD074\uB9AD\uD6C4 \uC628\uCCB4\uC778 \uB4F1\uB85D \uD655\uC778\uB418\uBA74, &quot;\uD22C\uD45C&quot; \uB2E8\uACC4\uB85C \uB3CC\uC544\uAC00\uC11C \uC2A4\uC2A4\uB85C\uC5D0\uAC8C \uD22C\uD45C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uD22C\uD45C\uB294 \uD2B9\uC815 \uACC4\uC88C\uC5D0 \uBCF4\uC99D\uAE08\uC744 \uC785\uAE08\uD558\uB294 \uBC29\uC2DD\uC73C\uB85C \uC774\uB8E8\uC5B4\uC9C0\uBA70,</p><p>\uBCF4\uC99D\uAE08\uC774 \uB9CE\uC744\uC218\uB85D \uB2F9\uCCA8 \uD655\uB960\uC774 \uB192\uC544\uC9D1\uB2C8\uB2E4</p><p>\uBB3C\uB860 \uB2F9\uC2E0\uC774 \uCEE4\uBBA4\uB2C8\uD2F0\uC5D0\uC11C \uB192\uC740 \uBA85\uC131\uC744 \uC5BB\uACE0 \uD22C\uD45C\uB97C \uBC1B\uC744\uC218 \uC788\uB294 \uAC15\uB825\uD55C \uB2A5\uB825\uC774 \uC788\uB2E4\uBA74 \uBAA8\uB4E0 \uC0AC\uB78C\uC744 \uB3D9\uC6D0\uD558\uC5EC \uC790\uC2E0\uC5D0\uAC8C \uD22C\uD45C\uD558\uB3C4\uB85D \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \u2014\u2014\uC774\uC0C1\uC740 \uC774\uC0AC\uD68C \uC120\uAC70\uC5D0 \uCC38\uC5EC\uD558\uAE30 \uC704\uD55C \uBAA8\uB4E0 \uC804\uB7B5\uC785\uB2C8\uB2E4.</p><p>\uD3EC\uC778\uD2B8: \uD22C\uD45C\uB97C \uD558\uB4E0 \uC120\uAC70\uB97C \uD558\uB4E0 \uB178\uB4DC \uAE30\uC874\uB178\uB4DC\uC5D0 \uB2F4\uBCF4\uB41C \uBCF4\uC99D\uAE08\uC744 \uD574\uC81C\uD560 \uD544\uC694\uAC00 \uC5C6\uC73C\uBA70, \uC218\uC775 \uBC0F \uC120\uAC70 \uBAA8\uB450 \uB3D9\uC2DC \uC9C4\uD589 \uAC00\uB2A5\uD569\uB2C8\uB2E4 !</p><hr><p>DBC \uBA54\uC778\uB137\uC774 Polkadot\uC73C\uB85C \uC644\uC804\uD788 \uC804\uD658\uB41C \uD6C4 \uCEE4\uBBA4\uB2C8\uD2F0 \uBBFC\uC8FC\uC801 \uAC70\uBC84\uB10C\uC2A4\uC758 \uCD94\uC9C4\uC774 \uD604\uC7AC \uC8FC\uC694 \uD589\uC0AC\uAC00 \uB418\uC5C8\uC2B5\uB2C8\uB2E4.</p><p>DBC \uC7AC\uB2E8\uC740 \uB9E4\uB2EC 425\uB9CC \uAC1C DBC\uB97C \uC628\uCCB4\uC778 \uAE30\uAE08\uC744 \uD22C\uC785\uD558\uBA70, \uC804\uBD80 \uCEE4\uBBA4\uB2C8\uD2F0\uAC00 \uC0AC\uC6A9\uD560 \uAC70\uBC84\uB10C\uC2A4 \uAE30\uAE08\uC73C\uB85C \uC0AC\uC6A9\uB429\uB2C8\uB2E4.</p><p>DBC \uCEE4\uBBA4\uB2C8\uD2F0\uC758 \uBAA8\uB4E0 \uAD6C\uC131\uC6D0\uC740 \uCEE4\uBBA4\uB2C8\uD2F0\uC758 \uC0DD\uD0DC\uC801 \uBC1C\uC804\uC5D0 \uC720\uC775\uD55C \uC77C\uC744 \uD558\uAE30 \uC704\uD574 \uAC70\uBC84\uB10C\uC2A4 \uAE30\uAE08\uC744 \uC2E0\uCCAD\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\uAE30\uAE08\uC740 \uC774\uC0AC\uD68C \uD22C\uD45C \uD1B5\uD574 \uD1B5\uACFC\uD558\uBA74 \uC5BB\uC744 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p>',34),n=[q];function d(l,g){return t(),o("div",null,n)}var D=p(m,[["render",d],["__file","join-council.html.vue"]]);export{D as default};
